import React, { useState } from 'react';
import styles from './Team.module.css';

const Team = () => {
  // Sample team data - This will be populated with scraped data from team_scraper.py
  // For now, using placeholder data to demonstrate the component structure
  const [teamMembers] = useState([
    {
      id: 1,
      name: 'Ing. Bijay Khanal',
      position: 'Director / Senior Engineer',
      image_url: 'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?auto=format&fit=crop&q=80&w=400',
      bio: 'Expert in hydropower development with 20+ years of experience in feasibility studies and detailed engineering design.'
    },
    {
      id: 2,
      name: 'Ing. Ramesh Prasad Pant',
      position: 'Senior Consultant',
      image_url: 'https://images.unsplash.com/photo-1500648767791-00dcc994a43e?auto=format&fit=crop&q=80&w=400',
      bio: 'Specialized in environmental impact assessment and sustainable energy solutions for hydropower projects.'
    },
    {
      id: 3,
      name: 'Eng. Prakash Sharma',
      position: 'Project Manager',
      image_url: 'https://images.unsplash.com/photo-1494790108377-be9c29b29330?auto=format&fit=crop&q=80&w=400',
      bio: 'Leads project management and monitoring activities with focus on timely delivery and quality assurance.'
    },
    {
      id: 4,
      name: 'Ms. Priya Thapa',
      position: 'Civil Engineer',
      image_url: 'https://images.unsplash.com/photo-1438761681033-6461ffad8d80?auto=format&fit=crop&q=80&w=400',
      bio: 'Specializes in geotechnical investigations, dam design, and detailed engineering for hydropower facilities.'
    },
    {
      id: 5,
      name: 'Eng. Narayan Joshi',
      position: 'Electrical Engineer',
      image_url: 'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?auto=format&fit=crop&q=80&w=400',
      bio: 'Expert in electrical design, electromechanical systems, and power evacuation for hydropower projects.'
    },
    {
      id: 6,
      name: 'Ms. Anita Kumari',
      position: 'Environmental Specialist',
      image_url: 'https://images.unsplash.com/photo-1494790108377-be9c29b29330?auto=format&fit=crop&q=80&w=400',
      bio: 'Focuses on environmental assessments, sustainability practices, and ecological management of projects.'
    }
  ]);

  const [selectedMember, setSelectedMember] = useState(null);
  const [selectedMenu, setSelectedMenu] = useState('Key Personnel');

  const menuOptions = [
    'Key Personnel',
    'Board of Directories',
    'Notices',
    'Annual Report',
    'Gallery'
  ];

  const renderContent = () => {
    switch(selectedMenu) {
      case 'Key Personnel':
        return (
          <div className={styles.teamGrid}>
            {teamMembers.map(member => (
              <div 
                key={member.id} 
                className={styles.teamCard}
                onClick={() => setSelectedMember(selectedMember?.id === member.id ? null : member)}
              >
                <div className={styles.imageContainer}>
                  <img src={member.image_url} alt={member.name} />
                  <div className={styles.overlay}>
                    <button className={styles.readMoreBtn}>
                      {selectedMember?.id === member.id ? 'Less' : 'More'}
                    </button>
                  </div>
                </div>
                <div className={styles.memberInfo}>
                  <h3>{member.name}</h3>
                  <p className={styles.position}>{member.position}</p>
                  {selectedMember?.id === member.id && (
                    <p className={styles.bio}>{member.bio}</p>
                  )}
                </div>
              </div>
            ))}
          </div>
        );
      case 'Board of Directories':
        return (
          <div className={styles.contentBox}>
            <h3>Board of Directors</h3>
            <p>Board member information and details to be added.</p>
            <p style={{color: '#999', fontSize: '0.9rem', marginTop: '10px'}}>Content coming soon...</p>
          </div>
        );
      case 'Notices':
        return (
          <div className={styles.contentBox}>
            <h3>Notices</h3>
            <p>Important notices and announcements from CEC Nepal.</p>
            <p style={{color: '#999', fontSize: '0.9rem', marginTop: '10px'}}>Content coming soon...</p>
          </div>
        );
      case 'Annual Report':
        return (
          <div className={styles.contentBox}>
            <h3>Annual Report</h3>
            <p>Access our latest annual reports and financial documents.</p>
            <p style={{color: '#999', fontSize: '0.9rem', marginTop: '10px'}}>Content coming soon...</p>
          </div>
        );
      case 'Gallery':
        return (
          <div className={styles.contentBox}>
            <h3>Gallery</h3>
            <p>Photo gallery and visual documentation of our projects.</p>
            <p style={{color: '#999', fontSize: '0.9rem', marginTop: '10px'}}>Content coming soon...</p>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <section id="team" className={styles.team}>
      <div className={styles.container}>
        <div className={styles.sectionHeader}>
          <h2>Our Team</h2>
          <p>Meet the experts behind CEC Nepal's success</p>
          <div className={styles.line}></div>
        </div>

        <div className={styles.dropdownContainer}>
          <select 
            value={selectedMenu} 
            onChange={(e) => setSelectedMenu(e.target.value)}
            className={styles.dropdownSelect}
          >
            {menuOptions.map(option => (
              <option key={option} value={option}>
                {option}
              </option>
            ))}
          </select>
        </div>

        {renderContent()}

        <div className={styles.teamStats}>
          <div className={styles.statItem}>
            <h4>{teamMembers.length}+</h4>
            <p>Expert Team Members</p>
          </div>
          <div className={styles.statItem}>
            <h4>20+</h4>
            <p>Years Combined Experience</p>
          </div>
          <div className={styles.statItem}>
            <h4>50+</h4>
            <p>Projects Completed</p>
          </div>
        </div>

        <div className={styles.joinTeamBox}>
          <h3>Join Our Team</h3>
          <p>We're always looking for talented engineers and consultants passionate about clean energy.</p>
          <a href="#contact" className={styles.ctaButton}>Contact Us for Opportunities</a>
        </div>
      </div>
    </section>
  );
};

export default Team;
